import React from "react";

export default function Modules() {
  const modules = [
    "Module de Monitoring et Historisation",
    "Module d'Alertes Intelligentes",
    "Module d'IA et recommandations",
    "Module de Vision Artificielle",
    "Module de Gestion Économique",
    "Chatbot IA Conversationnel",
  ];

  return (
    <section className="py-16 bg-white">
      <div className="container mx-auto px-6">
        <h2 className="text-3xl font-semibold mb-10 text-center">Modules</h2>
        <div className="grid md:grid-cols-3 gap-8">
          {modules.map((m, i) => (
            <div key={i} className="bg-green-50 p-6 rounded-lg card-shadow hover:bg-green-100 transition">
              <h3 className="text-lg font-semibold">{m}</h3>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
